import React, {Component} from 'react';
import {Link, BrowserRouter as Router} from 'react-router-dom';
import './Footer.css';
import github from '../../Images/001-github.svg';
import linkedin from '../../Images/002-linkedin.svg';
import whatsapp from '../../Images/003-whatsapp.svg';

class Footer extends Component {
    render() {
        return(
            <footer>
                <div className="container">
                    <div className="text-center center-block">
                        <Router>
                            <Link to="github.com/LuanColeto" target="_blank" className="icon-area">
                                <img src={github} target="_blank" width="50px" height="50px" className=" social-icon" id="github-icon" />
                            </Link>
                            <Link to="https://www.linkedin.com/in/luan-coleto-7b8b9b180/" target="_blank" className="icon-area">
                                <img src={linkedin} target="_blank" width="50px" height="50px" className=" social-icon " id="linkedin-icon" />
                            </Link>
                            <Link to="https://api.whatsapp.com/send?phone=5541999015631" target="_blank" className="icon-area">
                                <img src={whatsapp} target="_blank" width="50px" height="50px" className=" social-icon" id="whatsapp-icon" />
                            </Link>
                        </Router>
                    </div>

                </div>
            </footer>
        )
    }
}

export default Footer;
